import React from 'react';
import { Row, Col } from 'antd';
import AppLayout from '../components/Applayout';

const Profile = () => {

  return (
    <AppLayout>
      <Row style={{ backgroundColor: '#001521', height: '120px' }}>
      </Row>
      <Row>
        <Col span={12}>col-6</Col>
        <Col span={12}>col-6</Col>
      </Row>
    </AppLayout>
  );
};

export default Profile;
